import { BrowserRouter, Route, Routes } from "react-router-dom";
import { HOME } from "./Router";
import Home from "../screens/Home";

const Navigation = () => {
  return (
    <div>
      <BrowserRouter>
        <Routes>
          <Route exact path={HOME} element={<Home />} />
        </Routes>
      </BrowserRouter>
    </div>
  );
};

export default Navigation;
